import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Routes, Route } from 'react-router-dom';
import { NavLink, useNavigate } from 'react-router-dom';
import volcano from "./images/volcano-cropped.png"
import {Helmet} from 'react-helmet';



import './dist/output.css';
import Home from './Pages/Home';
import Vocabulary from './Pages/Vocabulary';
import Quizz from './Pages/Quizz';
import Domain from './Pages/Domain';
import Profile from './Pages/Profile';


function App() {

  return (
    <>
      {/* <Helmet>
        <style>{'body { background-color: whitesmoke; }'}</style>
      </Helmet>  */}
      <NavigationBar />
      <Routes>
        {/* <Route path="/login" element={<Login/>} /> */}
        <Route path="/" element={<Home />} />
        <Route path="/domain" element={<Domain />} />
        <Route path="/home" element={<Home />} />
        <Route path="/domain/eldercare" element={<Vocabulary domain="eldercare" />} />
        <Route path="/domain/construction" element={<Vocabulary domain="construction" />} />
        <Route path="/domain/construction/quizz" element={<Quizz domain="construction" />} />
        <Route path="/domain/eldercare/quizz" element={<Quizz domain="eldercare" />} />
        <Route path="/profile" element={<Profile />} />
      </Routes>
    </>
  )
}

function NavigationBar() {
  const navigate = useNavigate();
  const handleSelect = ((eventKey) => {
    navigate(eventKey);
  });

  // function requireAuth(nextState, replace, next) {
  //   if (!authenticated) {
  //     replace({
  //       pathname: "/login",
  //       state: {nextPathname: nextState.location.pathname}
  //     });
  //   }
  //   next();
  // }

  return (
    <nav className="bg-gray-800 shadow-md">
      <div className="relative max-w-screen-xl flex flex-wrap items-center justify-start mx-auto p-3">
        <a href="/home" className="flex items-center hover:bg-gray-700 px-3 rounded-md focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white">
          <img src={volcano} className="h-6 mr-3" />
          <span className="self-center text-xl font-semibold whitespace-nowrap text-white ">dola</span>
        </a>
        <a href="/domain" className="flex items-center  hover:bg-gray-700 px-3 rounded-md focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white">
          <span className="self-center text-xl font-semibold whitespace-nowrap text-white ">Domain</span>
        </a>
        <a href="/profile" className="flex items-center  hover:bg-gray-700 px-3 rounded-md focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white">
          <span className="self-center text-xl font-semibold whitespace-nowrap text-white ">Profile</span>
        </a>
      </div>
    </nav>


/* <nav class="bg-gray-800">
  <div class="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
    <div class="relative flex h-16 items-center justify-between">
      <div class="absolute inset-y-0 left-0 flex items-center sm:hidden">
        <!-- Mobile menu button-->
        <button type="button" class="relative inline-flex items-center justify-center rounded-md p-2 text-gray-400 hover:bg-gray-700 hover:text-white focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white" aria-controls="mobile-menu" aria-expanded="false">
          <span class="absolute -inset-0.5"></span>
          <span class="sr-only">Open main menu</span>
          <!--
            Icon when menu is closed.

            Menu open: "hidden", Menu closed: "block"
          -->
          <svg class="block h-6 w-6" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" aria-hidden="true">
            <path stroke-linecap="round" stroke-linejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5" />
          </svg>
          <!--
            Icon when menu is open.

            Menu open: "block", Menu closed: "hidden"
          -->
          <svg class="hidden h-6 w-6" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" aria-hidden="true">
            <path stroke-linecap="round" stroke-linejoin="round" d="M6 18L18 6M6 6l12 12" />
          </svg>
        </button>
      </div>
      <div class="flex flex-1 items-center justify-center sm:items-stretch sm:justify-start">
        <div class="flex flex-shrink-0 items-center">
          <img class="h-8 w-auto" src="https://tailwindui.com/img/logos/mark.svg?color=indigo&shade=500" alt="Your Company">
        </div>
        <div class="hidden sm:ml-6 sm:block">
          <div class="flex space-x-4">
            <!-- Current: "bg-gray-900 text-white", Default: "text-gray-300 hover:bg-gray-700 hover:text-white" -->
            <a href="#" class="bg-gray-900 text-white rounded-md px-3 py-2 text-sm font-medium" aria-current="page">Dashboard</a>
            <a href="#" class="text-gray-300 hover:bg-gray-700 hover:text-white rounded-md px-3 py-2 text-sm font-medium">Team</a>
